import React from "react";

import './style.css'

const BottomAddress = ( props ) =>{ 

    const { address } = props

    return (<div className="info-tips"><p>配送至：西南政法大学</p></div>)
}

const CheckBottomNav = ( props ) =>{

    const { data } = props

    return(
        <div id="check-Bottom-Nav">
           { data.address ?
            <BottomAddress address={data.address}/>
            : ''}
            <div className="check-bottom">
                <div className="ui-box ui-calc"><span>共{Number(data.quantity)}件 合计: <b>{Number(data.amount).toFixed(2)}</b></span></div>
                <div className="ui-box check-btn">付款</div>
            </div>
       </div>)
}

export default CheckBottomNav
